<style type="text/css">
p,td,th,body {

}

body {

}

	padding: 3px;
}

}

a {
	color: #797272;
	text-decoration: none;
}

#centre-container {

	min-height: 100%;
}

#content {
	background-color: white;
	padding: 20px;
}

.header {
	background-color: #A69B8F;
	padding: 20px;
}

.footer {
	background-color: #A69B8F;
	min-height: 40px;
}
</style>
